import React from "react";
import { MDBCol, MDBContainer, MDBRow, MDBFooter, MDBIcon, MDBBtn } from "mdbreact";

import Fb from 'react-ionicons/lib/LogoFacebook';

 let fa = {
    padding: '20px',
    fontSize: '30px',
    width: '70px',
    textAlign: 'center',
    textDecoration: 'none',
    margin: '5px 10px',
    borderRadius: '50%'
  }

  let fb = {
    background: '#3B5998',
    color: 'white'
  }

  let ft = {
    background: '#55ACEE',
    color: 'white'
  }
  let fg = {
    background: '#dd4b39',
    color: 'white'
}
let fi = {
    background: '#125688', 
    color : 'white'
}


const Footer = () => {
  return (
    <MDBFooter color="white" style = {{background :"black"}} className="navbar-fixed-bottom">
      <MDBContainer fluid className="text-center text-md-left">
        <MDBRow>
          <MDBCol md="6">
            <h3 className="title"><b>Contact Info </b></h3>
            <p>
                Mobile Number : +91 9988776655 <br/>
                Email         : vibrantvibes@gmail.com
            </p>
          </MDBCol>
          <MDBCol md="6">
            <h3>Follow Us</h3>
            <MDBRow>
              <div style = {{...fa, ...fb}}><Fb fontSize="30px" backgroundColor = "white" color="black"/></div>

                <a href="#" className="fas fa-band-aid" style = {{...fa, ...fb}}></a>
                <a href="#" className="fa fa-glass" style = {{...fa, ...ft}}></a>
                <a href="#" className="fa fa-google" style = {{...fa, ...fg}}></a>
                <a href="#" className="fa fa-instagram" style = {{...fa, ...fi}}></a>
            </MDBRow>
          </MDBCol>
        </MDBRow>
      </MDBContainer>
      <div className="footer-copyright text-center py-3">
        <MDBContainer fluid>
          &copy; {new Date().getFullYear()} Copyright: VibrantVibes.com
        </MDBContainer>
      </div>
    </MDBFooter>
  );
}

export default Footer;
